import styled from 'styled-components';
import { ReactComponent as CartLogo } from '../../../src-public/Icon.svg';

export const EmptyCartContainer = styled.div`
  position: absolute;
  width: 360px;
  height: 480px;
  margin-left: 120px;
  margin-top: 128px;

  background: #FFFFFF;
  border-radius: 4px;
`

export const CartLogoComponent = styled(CartLogo)`
  position: absolute;
  margin-left: 154px;
  margin-top: 170px;
`

export const EmptyTitle = styled.p`
  position: absolute;
  width: 185px;
  height: 32px;
  left: 88px;
  top: 232px;

  font-family: Open Sans;
  font-style: normal;
  font-weight: 600;
  font-size: 21px;
  line-height: 32px;

  text-align: center;
  color: #333333;
`

export const EmptySubtitle = styled.p`
  position: absolute;
  width: 227px;
  height: 48px;
  left: 67px;
  top: 272px;

  font-family: Open Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 24px;

  text-align: center;
  color: #333333;
`
